DROP TABLE IF EXISTS salessheet;
CREATE TABLE salessheet (
	OrderID	INTEGER,
	OrderDate	TEXT,
	CustomerID	INTEGER,
	CustomerName	TEXT,
	Address	TEXT,
	City	TEXT,
	State	TEXT,
	ZIP	INTEGER,
	Country	TEXT,
	Salesperson	TEXT,
	Region	TEXT,
	ShippedDate	TEXT,
	ShipperName	TEXT,
	ShipName	TEXT,
	ShipAddress	TEXT,
	ShipCity	TEXT,
	ShipState	TEXT,
	ShipZIP	INTEGER,
	ShipCountry	TEXT,
	PaymentType	TEXT,
	ProductName	TEXT,
	Category	TEXT,
	UnitPrice	REAL,
	Quantity	INTEGER,
	Revenue	REAL,
	ShippingFee	INTEGER,
	PRIMARY KEY(OrderID)
);
